def show_patterns():
	val_apps = {}
	os.makedirs("images")
	for (key, val) in known_patterns.items():
		siz = SQUARE_SIZE - EXTRA_SIZE
		im = Image.new(mode="RGB", size = (siz, siz))
		pixels = key.split(";")
		if val in val_apps:
			val_apps[val] += 1
		else:
			val_apps[val] = 1
		for (ind, pixel) in enumerate(pixels):
			colors = pixel.split(",")
			(x, y) = divmod(ind, siz)
			im.putpixel((x, y), (int(colors[0]), int(colors[1]), int(colors[2])))
		
		im.save(f"images/image_{val}_{val_apps[val]}.png")

