def save_custom_screenshot(dx, dy, width, height):
	with mss.mss() as sct:
		m: mss.Monitor = deepcopy(sct.monitors[0])
		m["left"] += dx
		m["top"] += dy
		m["width"] = width
		m["height"] = height
		ss = sct.grab(m)
		mss.tools.to_png(ss.rgb, ss.size, output = f"image{dx}_{dy}.png")

