def get_absolute_pos(x, y):
	return ((x + 0.5) * SQUARE_SIZE + startX, (y + 0.5) * SQUARE_SIZE + startY)

def read_pixel(ss: mss.screenshot, x, y):
	current: list[tuple[float, float, float]] = []
	if none == ss.pixel(x * SQUARE_SIZE + startX, y * SQUARE_SIZE + startY):
		results[(x, y)] = 100
		board[(x, y)] = 100
		return
	for dx in range (0, SQUARE_SIZE - EXTRA_SIZE):
		for dy in range(0, SQUARE_SIZE - EXTRA_SIZE):
			current.append(ss.pixel(x * SQUARE_SIZE + dx + startX, y * SQUARE_SIZE + dy + startY))
	string_repr = ";".join(list(map(lambda t: str(t[0]) + "," + str(t[1]) + "," + str(t[2]), current)))
	if string_repr not in known_patterns:
		results[(x, y)] = "-"
		board[(x, y)] = 100
		dx = x * SQUARE_SIZE + startX
		dy = y * SQUARE_SIZE + startY
		with open(f"image_{dx}_{dy}.txt", "w") as f:
			f.write(string_repr)
		save_custom_screenshot(dx, dy, SQUARE_SIZE - EXTRA_SIZE, SQUARE_SIZE - EXTRA_SIZE)

	else:
		results[(x, y)] = known_patterns[string_repr]
		board[(x, y)] = known_patterns[string_repr]

def read_board(ss: mss.screenshot):
	for y in range(0, sizeY):
		for x in range(0, sizeX):
			if (x, y) not in board or board[(x, y)] == 100 or board[(x, y)] < 0:
				read_pixel(ss, x, y)

def read_level(ss: mss.screenshot, first: bool):
	global current_level, old_level_pattern, lv_pattern
	current = []
	current_lv = []
	for y in range(0, SQUARE_SIZE * 2):
		for x in range(0, SQUARE_SIZE * 3):
			current.append(ss.pixel(x + startX, y + startY - 2 * SQUARE_SIZE - 5))
	for y in range(0, SQUARE_SIZE * 2):
		for x in range(0, SQUARE_SIZE):
			current_lv.append(ss.pixel(x + startX, y + startY - 2 * SQUARE_SIZE - 5))
	string_repr = ";".join(list(map(lambda t: str(t[0]) + "," + str(t[1]) + "," + str(t[2]), current)))
	string_repr_lv = ";".join(list(map(lambda t: str(t[0]) + "," + str(t[1]) + "," + str(t[2]), current_lv)))
	if first:
		lv_pattern = string_repr_lv
	if lv_pattern != string_repr_lv:
		return False
	if string_repr != old_level_pattern:
		current_level += 1
		old_level_pattern = string_repr
	return True

def read_screen(first_time: bool):
	global SQUARE_SIZE, startX, startY, sizeX, sizeY
	with mss.mss() as sct:
		ss = sct.grab(sct.monitors[0])
		if not first_time and not read_level(ss, first_time):
			return False

		if first_time:
			figure_out_board(ss)
		#	SQUARE_SIZE = 24
		#	startX = 352
		#	startY = 320
		#	sizeX = 50
		#	sizeY = 25
		else:
			read_board(ss)
		if first_time:
			read_level(ss, first_time)
		return True
	return False

def click(x, y):
    win32api.SetCursorPos((x,y))
    win32api.mouse_event(win32con.MOUSEEVENTF_LEFTDOWN,x,y,0,0)
    win32api.mouse_event(win32con.MOUSEEVENTF_LEFTUP,x,y,0,0)

def click_cell(x, y):
	if numclicked.get((x, y), 0) > 1:
		return
	p = get_absolute_pos(x, y)
	click(int(p[0]), int(p[1]))
	clicked[(x, y)] = True
	if (x, y) not in numclicked:
		numclicked[(x, y)] = 1
	else:
		numclicked[(x, y)] += 1
	time.sleep(0.005)

